ny_location), as.factor),\n","           experience_level = factor(experience_level, levels = c('EN', 'MI', 'SE', 'EX'), ordered = T ),\n","           employment_type = factor(employment_type, levels = c('FL','PT','CT','FT')),\n","           company_size = factor(company_size, levels = c(\"S\", \"M\", \"L\"), ordered = T)\n","          )\n","\n","orig_data %>% \n","    summary()"]},{"cell_type":"markdown","id":"ba5718d2","metadata":{"papermill":{"duration":0.006799,"end_time":"2022-11-28T02:12:51.866546","exception":false,"start_time":"2022-11-28T02:12:51.859747","status":"completed"},"tags":[]},"source":["### Cleaning Job Titles\n","**The job titles vary significantly, and many of the same types of jobs are referenced in different ways.  To make the job title more useful, a new encoding field will store the `super` class of the job indicated.**\n","\n","**There are also many job titles that include management or seniority measures.  These can be collected separately as the role level, with the default role level being \"1\".**"]},{"cell_type":"code","execution_count":2,"id":"f36d559c","metadata":{"execution":{"iopub.execute_input":"2022-11-28T02:12:51.910659Z","iopub.status.busy":"2022-11-28T02:12:51.881609Z","iopub.status.idle":"2022-11-28T02:12:52.662401Z","shell.execute_reply":"2022-11-28T02:12:52.66057Z"},"papermill":{"duration":0.792227,"end_time":"2022-11-28T02:12:52.665473","exception":false,"start_time":"2022-11-28T02:12:51.873246","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd5hU5cH+8Wf67GwFqYKKgKCiEjFi0BAFIdZoRIwtgIrG7qsSFX6KoKDRxGBJ\nVF5REhuCRqOxRhEFE0tsr7ERVGLBBuwuuzM7M6f//jg64p7CzOyU9fH7uby8lvPsOeee55yd\nvfdMC1iWJQAAAPDdF6x2AAAAAJQGxQ4AAEASFDsAAABJUOwAAAAkQbEDAACQBMUOAABAEhQ7\nAAAASVDsAAAAJBGudoASeOedd2bNmlX06qZpBoMuBdeyLMuynEP2ciGE61peWzNNUwgRCAQC\ngYBzyGu5/YVXBrK5LvfZEdnI9p3I5vND55XBHiJbtbLldkS24rLldnT66acfeOCBzm9D/mQo\ndoqiaJq22267FbGuZVmqqsZiM