n"," Data Scientist           :386    1         :1079    \n"," Data Engineer            :304    Manager   :  70    \n"," Data Analyst             :210    Senior    :  34    \n"," Machine Learning Engineer: 98    Consultant:  10    \n"," Engineer                 : 54    3         :   2    \n"," Architect                : 36    Junior    :   0    \n"," (Other)                  :107    (Other)   :   0    "]},"metadata":{},"output_type":"display_data"}],"source":["# str_detect with ability to pass in set of patterns to check\n","str_detect_any <- function(txt, patterns){\n","    return( any(\n","        vapply(patterns, function(x, t) str_detect(t, x), t = txt, FUN.VALUE = T)\n","    ))\n","}\n","\n","# Simplify job_title field\n","reduced_job_title <- function(title){\n","    title <- str_to_lower(title)\n","    if( str_detect_any(title, c(\"data scientist\", \"data science\")) ){\n","        \"Data Scientist\"\n","    } else if( str_detect_any(title, c(\"data engineer\", \"data engineering\"))){\n","        \"Data Engineer\"\n","    } else if( str_detect_any(title, c(\"software engineer\", \"software engineering\", \"develop\"))){\n","        \"Software Engineer\"\n","    } else if( str_detect_any(title, c(\"data analyst\", \"data analytics\"))){\n","        \"Data Analyst\"\n","    } else if( str_detect_any(title, c(\"machine learning engineer\", \"machine learning engineering\", \"ml\", \"nlp\"))){\n","        \"Machine Learning Engineer\"\n","    } else if( str_detect_any(title, c(\"applied scientist\", \"applied science\"))){\n","        \"Applied Scientist\"\n","    } else if( str_detect_any(title, \"research\") ){\n","        \"Researcher\"\n","    } else if( str_detect_any(title, c(\"engineer\", \"engineering\"))){\n","        \"Engineer\"\n","    } else if( str_detect_any(title, c(\"analyst\", \"analytics\"))){\n","        \"Analyst\"\n","    } else if( str_detect_any(title, c(\"scientist\", \"science\"))){\n","        \"Scientist\"\n","    } else if( str_detect_any(title, \"architect\")){\n","        \"Architect\"\n","    } else {\n","        \"Other\"\n","    }\n","}\n","        \n","# Identify role seniority from job_title\n","seniority <- function(title){\n","    title <- str_to_lower(title)\n","    if( str_detect_any(title, c(\"manage\", \"head\", \"direct\"))){\n","        \"Manager\"\n","    } else if( str_detect_any(title, \"consult\") ){\n","        \"Consultant\"\n","    } else if( str_detect_any(title, c(\"senior\",\"lead\", \"principal\", \"sr\"))){\n","        \"Senior\"\n","    } else if( str_detect(title, \"\\\\d\") ){\n","        str_extract(title, \"\\\\d\")\n","    } else if( str_detect_any(title, c(\"junior\", \"jr\", \"intern\"))){\n","        \"Junior\"\n","    } else {\n","        \"1\"\n","    }\n","} \n","\n","\n","data <- orig_data %>%     \n","        mutate(job_super_title = sapply(job_title, reduced_job_title) %>% \n","                    factor(),\n","               job_seniority_title = sapply(job_title, seniority) %>% \n","                    factor(levels = c(\"Junior\", \"Consultant\", \"0\", \"1\", \"2\", \"3\", \"Senior\", \"Manager\"), ordered = T) )\n","    \n","data %>%\n","    select(job_super_title, job_seniority_title) %>%\n","    summary()"]},{"cell_type":"markdown","id":"4c9f6644","metadata":{"papermill":{"duration":0.008992,"end_time":"2022-11-28T02:12:53.228666","exception":false,"start_time":"2022-11-28T02:12:53.219674","status":"completed"},"tags":[]},"source":["**Goal is to miss the fewest titles with this method - looks like only a few slip through (mostly managerial roles that will be identified by their seniority)**"]},{"cell_type":"code","execution_count":4,"id":"d1c5e2b0","metadata":{"execution":{"iopub.execute_input":"2022-11-28T02:12:53.254168Z","iopub.status.busy":"2022-11-28T02:12:53.246756Z","iopub.status.idle":"2022-11-28T02:12:53.298832Z","shell.execute_reply":"2022-11-28T02:12:53.296518Z"},"papermill":{"duration":0.065014,"end_time":"2022-11-28T02:12:53.301794","exception":false,"start_time":"2022-11-28T02:12:53.23678","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A grouped_df: 5 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>job_title</th><th scope=col>n</th></tr>\n","\t<tr><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;int&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>Data Manager            </td><td>5</td></tr>\n","\t<tr><td>Data Specialist         </td><td>6</td></tr>\n","\t<tr><td>Head of Data            </td><td>5</td></tr>\n","\t<tr><td>Head of Machine Learning</td><td>1</td></tr>\n","\t<tr><td>Machine Learning Manager</td><td>3</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A grouped\\_df: 5 × 2\n","\\begin{tabular}{ll}\n"," job\\_title & n\\\\\n"," <fct> & <int>\\\\\n","\\hline\n","\t Data Manager             & 5\\\\\n","\t Data Specialist          & 6\\\\\n","\t Head of Data             & 5\\\\\n","\t Head of Machine Learning & 1\\\\\n","\t Machine Learning Manager & 3\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A grouped_df: 5 × 2\n","\n","| job_title &lt;fct&gt; | n &lt;int&gt; |\n","|---|---|\n","| Data Manager             | 5 |\n","| Data Specialist          | 6 |\n","| Head of Data             | 5 |\n","| Head of Machine Learning | 1 |\n","| Machine Learning Manager | 3 |\n","\n"],"text/plain":["  job_title                n\n","1 Data Manager             5\n","2 Data Specialist          6\n","3 Head of Data             5\n","4 Head of Machine Learning 1\n","5 Machine Learning Manager 3"]},"metadata":{},"output_type":"display_data"}],"source":["other_title <- data %>% filter(job_super_title == 'Other') %>% group_by(job_title) %>% count()\n","other_title"]},{"cell_type":"markdown","id":"23f34702","metadata":{"papermill":{"duration":0.00844,"end_time":"2022-11-28T02:12:53.31875","exception":false,"start_time":"2022-11-28T02:12:53.31031","status":"completed"},"tags":[]},"source":["## Rise of Remote Work\n","\n","**Since the beginning of the pandemic in 2020 remote work has grown increasingly popular.  This data can be used to understand the impact of remote work on employee salaries and locations.**\n","\n","**Some questions that come immediately to mind are:**\n","* **What yearly trends exist in remote work offerings?**\n","* **Which roles are most amenable to remote work?**\n","* **Where do remote workers choose to live?**\n","    * **Which countries offer remote work?**\n","* **How much pay difference exists between remote workers?**\n","    * **Is there a difference related to the year the role was offered?**\n"]},{"cell_type":"markdown","id":"4f0bf7ae","metadata":{"papermill":{"duration":0.021419,"end_time":"2022-11-28T02:12:53.348302","exception":false,"start_time":"2022-11-28T02:12:53.326883","status":"completed"},"tags":[]},"source":["### What yearly trends exist in remote work offerings?\n","\n","**The first and simplest question is what are the yearly trends in remote work offers?  How much did remote work offers change over the 3 years.  This can be seen by plotting the frequency of on-site, hybrid, and remote roles over the 3 years given.**"]},{"cell_type":"code","execution_count":5,"id":"03ff5838","metadata":{"execution":{"iopub.execute_input":"2022-11-28T02:12:53.368513Z","iopub.status.busy":"2022-11-28T02:12:53.367079Z","iopub.status.idle":"2022-11-28T02:12:53.811264Z","shell.execute_reply":"2022-11-28T02:12:53.808387Z"},"papermill":{"duration":0.457797,"end_time":"2022-11-28T02:12:53.81454","exception":false,"start_time":"2022-11-28T02:12:53.356743","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2AUVRuG4Xd2N5tONiFAQuih9yK9SpUiCoJgoYiAUqWJSBEQpKiAgCKogJ+A\nggqCKDaQJkVFFBQBaSK9B9K3zfdjIYTUTUghh/v6tXNm5px3JpPsk9mZWU3XdQEAAEDeZ8jt\nAgAAAJA1CHYAAACKINgBAAAogmAHAACgCIIdAACAIgh2AAAAiiDYAQAAKIJgBwAAoIi8FOx+\nGV5Fc0PHfZdyu1K3xJzf/EyLWsF+5kKVxqa2TCVfc/INNBhM/pYCNRq3m/rB986Mj7t