**The two charts above show how remote offerings in ML roles changes over the course of the pandemic.  Both have the obvious trend where remote offerings peak in 2021 (after employers had accepted the need for workers to stay home), but with in-office and hybrid offerings increasing in 2022.  The fall of hybrid work is most clear in the first chart, which shows how more roles offered a hybrid offering in 2021 than 2020, but these types of roles decreased dramatically in 2022.**\n","\n","**The subtle color and width variation in the second chart represent the standard deviatio in the amount of remote time offered across all roles in a given year.  In 2021 there were both more remote roles and less variance in the remote time offered (because most roles were 50% or 100% remote).  In 2022 that variance increases noticeably as more roles are explicitly 0% or 100% remote.  2020 is somewhat in the middle, because the number of offerings of remote, hybrid, and on-site roles are more even.**"]},{"cell_type":"markdown","id":"c60c189a","metadata":{"papermill":{"duration":0.009936,"end_time":"2022-11-28T02:12:54.197833","exception":false,"start_time":"2022-11-28T02:12:54.187897","status":"completed"},"tags":[]},"source":["### Which roles are most amenable to remote work?\n","\n","It should be easy to discern the roles that offer the most remote roles based on the way the data is split out.  Beyond just the job title, there could be differences in terms of the level of seniority and the year in which the job was offered that "]},{"cell_type":"code","execution_count":7,"id":"afdaaadd","metadata":{"execution":{"iopub.execute_input":"2022-11-28T02:12:54.221359Z","iopub.status.busy":"2022-11-28T02:12:54.219678Z","iopub.status.idle":"2022-11-28T02:12:54.753411Z","shell.execute_reply":"2022-11-28T02:12:54.750619Z"},"papermill":{"duration":0.549794,"end_time":"2022-11-28T02:12:54.757401","exception":false,"start_time":"2022-11-28T02:12:54.207607","status":"completed"},"tags":[]},"outp