remote_pct', 1, 0)), show.legend = F) +\n","            geom_text(aes(x = !! main_col, y = if_else(hybrid == 0, no_remote / count * 100 + 3, (hybrid + no_remote) / count * 100 - 3), label=paste0(round((hybrid)/count * 100), '%'), alpha = ifelse(remote=='full_remote_pct', 1, 0)), show.legend = F) +\n","            geom_text(aes(x = !! main_col, y = (no_remote / count * 100 - 3), label=paste0(round((no_remote)/count * 100), '%'), alpha = ifelse(remote=='full_remote_pct', 1, 0)), show.legend = F) +\n","            labs( title = \"Remote Work Offerings\", subtitle = paste0(\"by \", main_col, if_else(is.null(group_cols), '', paste0(' and ', group_cols))), y = 'Percent %', fill = \"Policy\", alpha = NULL) +\n","            theme_bw() +\n","            theme(axis.text.x = element_text(angle = 60, vjust = 0.5, hjust=0.5))\n","    return(p)\n","}\n","\n","remote_work_breakdown(data, 'job_super_title', NULL, 16, 8)\n"]},{"cell_type":"markdown","id":"a316e315","metadata":{"papermill":{"duration":0.012118,"end_time":"2022-11-28T02:12:54.783856","exception":false,"start_time":"2022-11-28T02:12:54.771738","status":"completed"},"tags":[]},"source":["**For most roles, above 50% of offerings are fully remote.  From this chart it appears as though research roles are the least amenable to remote work, but the most likely to request hybrid work.  Surprisingly, roles in research, data science, data engineering, and (other) engineering all require onsite work about 30% of the time.  The seniority and year in which the role is offered may also impact the rate of remote work.**"]},{"cell_type":"code","execution_count":8,"id":"bdeb6e19","metadata":{"execution":{"iopub.execute_input":"2022-11-28T02:12:54.813729Z","iopub.status.busy":"2022-11-28T02:12:54.81218Z","iopub.status.idle":"2022-11-28T02:12:55.26019Z","shell.execute_reply":"2022-11-28T02:12:55.258334Z"},"papermill":{"duration":0.464735,"end_time":"2022-11-28T02:12:55.262442","exception":false,"start_time":"2022-11-28T02:12:54.797707"