 :2.804e+10   Max.   :30400000   Max.   :922.230  "]},"metadata":{},"output_type":"display_data"}],"source":["# Daily exchange rate for global currencies on the most recent date\n","exchange_rates <- read_csv('../input/currency-exchange-rates/exchange_rates.csv') %>%\n","    mutate(date = lubridate::dmy(date)) %>% \n","    filter(date == max(date)) %>%\n","    select(currency, value) \n","\n","# USD to EUR exchange rate (EUR based)\n","USD_RATE = exchange_rates$value[exchange_rates$currency == 'USD']\n","\n","# Convert exchange to USD base\n","exchange_rates <- exchange_rates %>% \n","    mutate(USD_value = value / USD_RATE)\n","\n","# Add USD salary by conversion\n","converted_data <- data %>%\n","    inner_join(exchange_rates, by = c(\"salary_currency\"=\"currency\")) %>%\n","    mutate(usd_salary = USD_value * salary)\n","\n","summary(converted_data %>% select(usd_salary, salary, USD_value))"]},{"cell_type":"code","execution_count":13,"id":"03455d2c","metadata":{"execution":{"iopub.execute_input":"2022-11-28T02:13:00.137376Z","iopub.status.busy":"2022-11-28T02:13:00.135956Z","iopub.status.idle":"2022-11-28T02:13:01.175245Z","shell.execute_reply":"2022-11-28T02:13:01.173528Z"},"papermill":{"duration":1.062036,"end_time":"2022-11-28T02:13:01.178086","exception":false,"start_time":"2022-11-28T02:13:00.11605","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'remote', 'work_year'. You can override\n","using the `.groups` argument.\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3xTVRsH8OfmJmm6J7RQ9rJQRhmiIMhqgbK1pewhe++99xCkgExFpgwRkaGI\nCLwMZYOATNnIhhZKs5N77/tHIIQ2SdMmXbe/7x98kpNzz3nOeZL0IeOGEQSBAAAAACD3k2R3\nAAAAAADgGijsAAAAAEQChR0AAACASKCwAwAAABAJFHYAAAAAIoHCDgAAAEAkUNgBAAAAiAQK\nOwAAAACRyLuF3b+rWzEMI2EVmx+qrHYQjK8aBLgzDFO216+ZGsnFuR8yDNNg512XjCbwqjIe\ncoZhJKz8jNLgkjFzHU57/7vZw6JqVszn7yOTyn0CC1at22Li11u