mean much higher than the median.  Overall though, among countries with high representation (more than 5 employee residents), there isn't a massive difference between mean and median salaries.  The best salaries offered (in terms of USD) seem to be in Brazil, while the lowest pay in USD is in Pakistan.  These values don't account for job titles or seniority, but it still offers some insight into the wide differences in compensation in terms of USD by country.**"]},{"cell_type":"code","execution_count":null,"id":"9a31fb29","metadata":{"papermill":{"duration":0.020256,"end_time":"2022-11-28T02:13:01.71352","exception":false,"start_time":"2022-11-28T02:13:01.693264","status":"completed"},"tags":[]},"outputs":[],"source":[]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":16.073947,"end_time":"2022-11-28T02:13:01.863981","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-11-28T02:12:45.790034","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}